import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/footer';
import Home from './components/Home';
import Login from './auth/Login';
import Register from './auth/Register';
import PrivateRoute from './auth/PrivateRoute';
import PatientDashboard from './pages/PatientDashboard';
import AdminDashboard from './pages/AdminDashboard';
import MedecinDashboard from './pages/MedecinDashboard';
import PharmacienDashboard from './pages/PharmacienDashboard';

function App() {
  return (
    <div className="min-h-screen flex flex-col bg-gray-50">
      <Navbar />
      <main className="flex-grow">
        <Routes>
          {/* Pages publiques */}
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />

          {/* ✅ TOUS LES RÔLES avec PrivateRoute */}
          <Route path="/patient/*" element={
            <PrivateRoute allowedRoles={['Patient']}>
              <PatientDashboard />
            </PrivateRoute>
          } />

          <Route path="/admin/*" element={
            <PrivateRoute allowedRoles={['Admin', 'SuperAdmin']}>
              <AdminDashboard />
            </PrivateRoute>
          } />

          <Route path="/medecin/*" element={
            <PrivateRoute allowedRoles={['Medecin']}>
              <MedecinDashboard />
            </PrivateRoute>
          } />

          <Route path="/moderateur/*" element={
            <PrivateRoute allowedRoles={['Moderateur']}>
              <AdminDashboard />
            </PrivateRoute>
          } />

          <Route path="/pharmacien/*" element={
            <PrivateRoute allowedRoles={['Pharmacien']}>
              <PharmacienDashboard />
            </PrivateRoute>
          } />

          <Route path="/service/*" element={
            <PrivateRoute allowedRoles={['Assistant', 'AideSoignant', 'Stagiaire', 'MediateurNumerique']}>
              <AdminDashboard />
            </PrivateRoute>
          } />

          {/* Redirection */}
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </main>
      <Footer />
    </div>
  );
}

export default App;
